import ColumnChart from "./ColumnChart";
import PieChart from "./PieChart";
import LineChart from "./LineChart";

function Charts() {
  return <>
  <div style={{display:"flex",flexDirection:"row",width:"100%"}}>





        <div class="row">
          <div class="col-lg-4"><ColumnChart></ColumnChart></div>
          <div class="col-lg-4"><PieChart></PieChart></div>
          <div class="col-sm-4"><LineChart></LineChart></div>
        </div>

        <div name="extra_info">

        </div>

  </div>





  </>
}

export default Charts;
